1\r\n}\r\n\r\n;;----------------------------------------------------\r\n;; \u30e2\u30fc\u30c9\u5909\u66f4\u30eb\u30fc\u30c1\u30f3\r\n;;----------------------------------------------------\r\n\r\nChangeNomalMainMode() {\r\n    mode := NOMAL_MAIN_MODE\r\n}\r\n\r\nChangeNomalSubMode() {\r\n    mode := NOMAL_SUB_MODE\r\n}\r\n\r\nChangeAppMainMode() {\r\n    if (WinActive(\"ahk_exe atom.exe\")) {\r\n        Send, {Esc}     \r\n        atom_cursor_mode := ATOM_MOVING_TEXT_MODE\r\n    }\r\n    else if (WinActive(\"ahk_exe chrome.exe\")) {\r\n    }\r\n    else if (WinActive(\"ahk_exe FreeCommander.EXE\")) {\r\n        free_commander_is_file_selecting := false\r\n    }\r\n    mode := APP_MAIN_MODE\r\n}\r\n\r\nChangeAppSubMode() {\r\n    if (WinActive(\"ahk_exe atom.exe\")) {\r\n        atom_window_is_tree_view := false\r\n    }\r\n    mode := APP_SUB_MODE\r\n}\r\n\r\nChangeSelectAppMode() {\r\n    mode := SELECT_APP_MODE\r\n}\r\n\r\n;;----------------------------------------------------\r\n;; Atom\u30a2\u30d7\u30ea\u56fa\u6709\u30e2\u30fc\u30c9\r\n;;----------------------------------------------------\r\n#if (WinActive(\"ahk_exe atom.exe\")) && (mode = APP_MAIN_MODE)\r\n\r\n;; \u65b0\u898f\u4f5c\u6210\u3001\u524a\u9664\r\nn::\r\n    Send, {End}\r\n    Send, {Enter}\r\n    ChangeNomalMainMode()\r\nb::\r\n    Send, ^+k\r\nreturn\r\n\r\n;; \u30b3\u30d4\u30fc\u3001\u8cbc\u308a\u4ed8\u3051\u3001\u5207\u308a\u53d6\u308a\u3001\u5143\u306b\u623b\u3059\r\nc::\r\n    Send, ^c\r\n    Send, {Esc}\r\n    atom_cursor_mode := ATOM_MOVING_TEXT_MODE\r\nreturn\r\nv::\r\n    Send, ^v\r\n    Send, {Esc}\r\n    atom_cursor_mode := ATOM_MOVING_TEXT_MODE\r\nreturn\r\nx::\r\n    Send, ^x\r\n    Send, {Esc}\r\n    atom_cursor_mode := ATOM_MOVING_TEXT_MODE\r\nreturn\r\nz::\r\n    Send, ^z\r\nreturn\r\n\r\n;; \u524d\u3092\u6d88\u3059\u3001\u5f8c\u308d\u3092\u6d88\u3059\r\ng::Send, {Bs}\r\nh::Send, {Del}\r\n\r\n;; \u79fb\u52d5\r\ni::\r\n    if (atom_cursor_mode = ATOM_MOVING_TEXT_MODE)\r\n        Send, {Up}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_TEXT_MODE)\r\n        Send, +{Up}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_KUKEI_TEXT_MODE)\r\n        Send, ^!{Up}\r\nreturn\r\n\r\nk::\r\n    if (atom_cursor_mode = ATOM_MOVING_TEXT_MODE)\r\n        Send, {Down}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_TEXT_MODE)\r\n        Send, +{Down}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_KUKEI_TEXT_MODE)\r\n        Send, ^!{Down}\r\nreturn\r\n\r\nj::\r\n    if (atom_cursor_mode = ATOM_MOVING_TEXT_MODE)\r\n        Send, {Left}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_TEXT_MODE)\r\n        Send, +{Left}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_KUKEI_TEXT_MODE)\r\n        Send, +{Left}\r\nreturn\r\n\r\nl::\r\n    if (atom_cursor_mode = ATOM_MOVING_TEXT_MODE)\r\n        Send, {Right}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_TEXT_MODE)\r\n        Send, +{Right}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_KUKEI_TEXT_MODE)\r\n        Send, +{Right}\r\nreturn\r\n\r\n;; \u5927\u304d\u304f\u79fb\u52d5\r\ne::\r\n    if (atom_cursor_mode = ATOM_MOVING_TEXT_MODE)\r\n        Send, {PgUp}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_TEXT_MODE)\r\n        Send, +{Up 10}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_KUKEI_TEXT_MODE)\r\n        Send, ^!{Up 10}\r\nreturn\r\n\r\nd::\r\n    if (atom_cursor_mode = ATOM_MOVING_TEXT_MODE)\r\n        Send, {PgDn}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_TEXT_MODE)\r\n        Send, +{Down 10}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_KUKEI_TEXT_MODE)\r\n        Send, ^!{Down 10}\r\nreturn\r\n\r\ns::\r\n    if (atom_cursor_mode = ATOM_MOVING_TEXT_MODE)\r\n        Send, {Home}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_TEXT_MODE)\r\n        Send, +{Home}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_KUKEI_TEXT_MODE)\r\n        Send, +{Left 3}\r\nreturn\r\n\r\nf::\r\n    if (atom_cursor_mode = ATOM_MOVING_TEXT_MODE)\r\n        Send, {End}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_TEXT_MODE)\r\n        Send, +{End}\r\n    else if (atom_cursor_mode = ATOM_SELECTING_KUKEI_TEXT_MODE)\r\n        Send, +{Right 3}\r\nreturn\r\n\r\n;; \u63a2\u3059\r\no::\r\n    Send, ^f\r\nreturn\r\n\r\n;; \u5909\u66f4\u3001\u4e00\u3064\u9078\u629e\u3001\u30b0\u30eb\u30fc\u30d7\u9078\u629e\u3001\u30b0\u30eb\u30fc\u30d7\u9078\u629e\r\nr::\r\n    Send, !{F3}\r\n    ChangeNomalMainMode()\r\nreturn\r\nt::\r\n    Send, ^d\r\nreturn\r\n+t::\r\n    Send, ^u\r\nreturn\r\ny::\r\n    Send, {Esc}\r\n    atom_cursor_mode := ATOM_SELECTING_KUKEI_TEXT_MODE\r\nreturn\r\nu::\r\n    Send, {Esc}\r\n    atom_cursor_mode := ATOM_SELECTING_TEXT_MODE\r\nreturn\r\n\r\n;;;; \u9078\u629e\u30e2\u30fc\u30c9\u3067\u306f\u9023\u7d9a\u3057\u3066shift + \u79fb\u52d5\u30ad\u30fc\u3092\u9001\u308a\u7d9a\u304d\u308b\u304c\u3001\u6b21\u306e\u30ad\u30fc\u3092\u62bc\u4e0b\u3057\u305f\u3068\u304d\u306b\r\n;;;; shift\u304c\u5165\u308a\u3063\u3071\u306a\u3057\u306b\u306a\u308b\u554f\u984c\u304c\u767a\u751f\u3057\u305f\u305f\u3081\u3001\u66ab\u5b9a\u5bfe\u5fdc\u3068\u3057\u3066\u4ee5\u4e0b\u306e\u30ad\u30fc\u3092\u7121\u8996\u3059\u308b\u3002\r\n+i::return\r\n+k::return\r\n+j::return\r\n+l::return\r\n+e::return\r\n+d::return\r\n+s::return\r\n+f::return\r\n\r\n#if\r\n\r\n;;----------------------------------------------------\r\n;; Atom\u30a2\u30d7\u30ea\u56fa\u6709\u30e2\u30fc\u30c9\uff08\u88dc\u52a9\uff09\r\n;;----------------------------------------------------\r\n#if (WinActive(\"ahk_exe atom.exe\")) && (mode = APP_SUB_MODE)\r\n\r\n;; \u65b0\u898f\u4f5c\u6210\u3001\u524a\u9664\r\nn::\r\n    Send, ^n\r\nreturn\r\nb::\r\n    Send, ^w\r\nreturn\r\n\r\n;; \u30b3\u30d4\u30fc\u3001\u8cbc\u308a\u4ed8\u3051\u3001\u5207\u308a\u53d6\u308a\u3001\u5143\u306b\u623b\u3059\r\nc::\r\nv::\r\n    Send, ^k\r\n    Send, {Left}\r\nreturn\r\nx::\r\nz::\r\n    Send, ^k\r\n    Send, ^w\r\nreturn\r\n\r\n;; \u79fb\u52d5\r\ni::\r\n    Send, {Up}\r\nreturn\r\nk::\r\n    Send, {Down}\r\nreturn\r\nj::\r\n    Send, ^{PgUp}\r\nreturn\r\nl::\r\n    Send, ^{PgDn}\r\nreturn\r\n\r\n;; \u5927\u304d\u304f\u79fb\u52d5\r\ne::\r\n    Send, {Esc}\r\n    Send, \\\r\nreturn\r\nd::\r\n    Send, {Esc}\r\nreturn\r\ns::\r\n    Send, {Esc}\r\n    Send, ^k\r\n    Send, ^p\r\nreturn\r\nf::\r\n    Send, {Esc}\r\n    Send, ^k\r\n    Send, ^n\r\nreturn\r\n\r\n#if\r\n\r\n;;----------------------------------------------------\r\n;; Atom\u5165\u529b\u30e2\u30fc\u30c9\uff08\u88dc\u52a9\uff09\r\n;;----------------------------------------------------\r\n#if (WinActive(\"ahk_exe atom.exe\")) && (mode = NOMAL_SUB_MODE)\r\n\r\n;; \u79fb\u52d5\r\ni::\r\n    Send, {Up}\r\nreturn\r\nk::\r\n    Send, {Down}\r\nreturn\r\nj::\r\n    Send, {Left}\r\nreturn\r\nl::\r\n    Send, {Right}\r\nreturn\r\n\r\n#if\r\n\r\n;;----------------------------------------------------\r\n;; \u5165\u529b\u30e2\u30fc\u30c9\uff08\u88dc\u52a9\uff09\r\n;;----------------------------------------------------\r\n#if (mode = NOMAL_SUB_MODE)\r\n\r\nn::\r\n    IME_SET(1)\r\nreturn\r\n\r\ne::\r\n    IME_SET(0)\r\nreturn\r\n\r\n#if\r\n\r\n;;----------------------------------------------------\r\n;; \u3059\u3079\u3066\u3082\u30e2\u30fc\u30c9\u3067\u5171\u901a\r\n;;----------------------------------------------------\r\nsc03a::\r\n    Send, !{Tab}\r\nreturn\r\n\r\nsc07B::\r\n    ChangeNomalSubMode()\r\n    while (GetKeyState(\"sc07B\", \"P\")) {\r\n        Sleep, 100\r\n    }\r\n    ChangeNomalMainMode()\r\nreturn\r\nsc079::\r\n    ChangeAppSubMode()\r\n    while (GetKeyState(\"sc079\", \"P\")) {\r\n        Sleep, 100\r\n    }\r\n    ChangeAppMainMode()\r\nreturn\r\n"
