history_108 = "\u3053\u3093\u3070\u3093\u306f\u3002\u305f\u3051\u3061\u3088\u3067\u3059\u3002\r\n\r\n\u5148\u65e5\u3001\u6d17\u6fef\u6a5f\u3092\u8cfc\u5165\u3057\u307e\u3057\u305f\u3002\r\n\u30c9\u30e9\u30e0\u5f0f\u6d17\u6fef\u6a5f\u3067\u3001\u7d50\u69cb\u3044\u3044\u3084\u3064\u3067\u3067\u3059\u3002\r\n\r\n\u6d17\u6fef\u6a5f\u3092\u9078\u3093\u3067\u3044\u3066\u3001\u8cb7\u3044\u7269\u3059\u308b\u306e\u3082\u5927\u5909\u3084\u306a\u6642\u4ee3\u306b\u306a\u3063\u305f\u306a\uff5e\u3068\u601d\u3044\u307e\u3057\u305f\u3002\r\n\u30a4\u30f3\u30bf\u30fc\u30cd\u30c3\u30c8\u306e\u767a\u9054\u306b\u3088\u308a\u60c5\u5831\u304c\u7c21\u5358\u306b\u624b\u306b\u5165\u308b\u3088\u3046\u306b\u306a\u3063\u305f\u5206\u3001\u8cb7\u3044\u7269\u6642\u306b\u8003\u3048\u308b\u3053\u3068\u304c\u304b\u306a\u308a\u591a\u304f\u306a\u308a\u307e\u3057\u305f\u3002\r\n\u4e00\u6614\u307e\u3048\u3060\u3063\u305f\u3089\u3001\u60c5\u5831\u3092\u96c6\u3081\u308b\u3053\u3068\u30675000\u5186\u5f97\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u3066\u3082\u3001\u60c5\u5831\u3092\u624b\u306b\u5165\u308c\u308b\u306e\u306b\u4e00\u65e5\u304b\u304b\u308b\u306a\u3089\u30d0\u30ab\u30d0\u30ab\u3057\u3044\u304b\u3089\u3001\r\n\u3042\u307e\u308a\u6df1\u304f\u8003\u3048\u305a\u306b\u9069\u5f53\u306b\u9078\u307c\u3046\u3063\u3066\u306a\u3063\u3066\u3044\u305f\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u3002\r\n\u3057\u304b\u3057\u3001\u4eca\u306f10\u5206\u3082\u3042\u308c\u3070\u5927\u4f53\u306e\u60c5\u5831\u304c\u624b\u306b\u5165\u3063\u3066\u3057\u307e\u3044\u307e\u3059\u3002\r\n\u306a\u306e\u3067\u3001\u60c5\u5831\u3092\u96c6\u3081\u305a\u306b\u8cb7\u3044\u7269\u3092\u3059\u308b\u3068\u5927\u4f53\u306e\u5834\u5408\u3001\u305d\u306e\u4eba\u306e\u6642\u7d66\u4ee5\u4e0a\u306e\u640d\u5f97\u304c\u751f\u307e\u308c\u3066\u3057\u307e\u3046\u3067\u3057\u3087\u3046\u3002\r\n\u3082\u3057\u50d5\u304c\u79d2\u901f\u3067\u4e00\u5104\u5186\u7a3c\u3052\u308b\u4eba\u9593\u3067\u3042\u308c\u3070\u3001\u6642\u9593\u306e\u307b\u3046\u304c\u5927\u4e8b\u306a\u306e\u3067\u305d\u3093\u306a\u3053\u3068\u6c17\u306b\u3057\u307e\u305b\u3093\u304c\u3001\r\n\u3053\u306e\u30d6\u30ed\u30b0\u3092\u66f8\u3044\u3066\u3044\u308b\u50d5\u306e\u6642\u7d66\u306f\u305b\u3044\u305c\u304430\u5186\u3067\u3057\u3087\u3046\u3002\r\n\r\n\u643a\u5e2f\u306e\u5951\u7d04\u306a\u3093\u304b\u3082\u7d50\u69cb\u5927\u5909\u3067\u3001\u6614\u306b\u6bd4\u3079\u9078\u629e\u80a2\u304c\u591a\u3044\u5206\u3067\u3001\u8003\u3048\u308b\u3053\u3068\u304c\u304b\u306a\u308a\u591a\u304f\u306a\u308a\u307e\u3057\u305f\u3002\r\n\u96fb\u529b\u3001\u30ac\u30b9\u3082\u81ea\u7531\u5316\u3067\u9078\u629e\u80a2\u304c\u5897\u3048\u305f\u305f\u3081\u3001\u8003\u3048\u308b\u5fc5\u8981\u304c\u3067\u3066\u304d\u307e\u3057\u305f\u3002\r\n\r\n\u305d\u3093\u306a\u3053\u3093\u306a\u3067\u73fe\u4ee3\u4eba\u306f\u8003\u3048\u306a\u3044\u3068\u3044\u3051\u306a\u3044\u3053\u3068\u304c\u305f\u304f\u3055\u3093\u3042\u3063\u3066\u3001\u5b9f\u969b\u5e78\u305b\u306a\u306e\u304b\u3069\u3046\u304b\u3088\u304f\u308f\u304b\u3089\u306a\u3044\u306a\uff5e\u3068\u601d\u3044\u307e\u3057\u305f\u3002\r\n\r\n\u305d\u3057\u3066\u3001\u4eca\u65e5\uff01\r\n\u8cfc\u5165\u3057\u305f\u6d17\u6fef\u6a5f\u304c\u5348\u524d\u4e2d\u306b\u5c4a\u304f\u4e88\u5b9a\u3060\u3063\u305f\u306e\u3067\u3001\u671d\u304b\u3089\u305a\u3063\u3068\u5bb6\u3067\u5f85\u3063\u3066\u3044\u307e\u3057\u305f\u3002\r\n\u3057\u304b\u3057\u300116\u6642\u306b\u306a\u3063\u3066\u3082\u4e00\u5411\u306b\u3053\u306a\u3044\u306e\u3067\u3001\u96fb\u8a71\u3067\u78ba\u8a8d\u3057\u3066\u307f\u305f\u3068\u3053\u308d\u3001\u4f55\u304b\u306e\u624b\u9055\u3044\u3067\u914d\u9054\u65e5\u304c\u4e00\u30f6\u6708\u5148\u306b\u306a\u3063\u3066\u3044\u307e\u3057\u305f\u3002\r\n\r\n\u305d\u3093\u306a\u3053\u3068\u304c\u3042\u3063\u305f\u306e\u3067\u3001\u663c\u304b\u3089\u5916\u51fa\u3057\u3088\u3046\u3068\u601d\u3063\u3066\u3044\u307e\u3057\u305f\u304c\u3001\u4eca\u65e5\u306f\u4e00\u65e5\u5bb6\u3067\u904e\u3054\u3059\u3053\u3068\u306b\u306a\u308a\u307e\u3057\u305f\u3002\r\n\r\n\u30d3\u30c3\u30af\u30ab\u25cb\u30e9\u3055\u3093\u3001\u3057\u3063\u304b\u308a\u3057\u3066\u304f\u3060\u3055\u3044\u3002\r\n\u307b\u3093\u3068\u306b\u3082\u3046\uff01\uff01"
history_109 = "\u3053\u3093\u3070\u3093\u306f\u3002\u305f\u3051\u3061\u3088\u3067\u3059\u3002\r\n\r\n\u5148\u65e5\u3001\u6d17\u6fef\u6a5f\u3092\u8cfc\u5165\u3057\u307e\u3057\u305f\u3002\r\n\u30c9\u30e9\u30e0\u5f0f\u6d17\u6fef\u6a5f\u3067\u3001\u7d50\u69cb\u3044\u3044\u3084\u3064\u3067\u3067\u3059\u3002\r\n\r\n\u8cb7\u3044\u7269\u3092\u3057\u3066\u3044\u3066\u3001\u8cb7\u3044\u7269\u3059\u308b\u306e\u3082\u5927\u5909\u3084\u306a\u6642\u4ee3\u306b\u306a\u3063\u305f\u306a\uff5e\u3068\u601d\u3044\u307e\u3057\u305f\u3002\r\n\u30a4\u30f3\u30bf\u30fc\u30cd\u30c3\u30c8\u306e\u767a\u9054\u306b\u3088\u308a\u60c5\u5831\u304c\u7c21\u5358\u306b\u624b\u306b\u5165\u308b\u3088\u3046\u306b\u306a\u3063\u305f\u5206\u3001\u8cb7\u3044\u7269\u6642\u306b\u8003\u3048\u308b\u3053\u3068\u304c\u304b\u306a\u308a\u591a\u304f\u306a\u308a\u307e\u3057\u305f\u3002\r\n\u4e00\u6614\u307e\u3048\u3060\u3063\u305f\u3089\u30015000\u5186\u5f97\u3059\u308b\u305f\u3081\u306e\u60c5\u5831\u304c\u3042\u3063\u3066\u3082\u3001\u305d\u306e\u60c5\u5831\u3092\u624b\u306b\u5165\u308c\u308b\u306e\u306b\u4e00\u65e5\u304b\u304b\u308b\u306a\u3089\u30d0\u30ab\u30d0\u30ab\u3057\u3044\u304b\u3089\u3001\r\n\u3042\u307e\u308a\u6df1\u304f\u8003\u3048\u305a\u306b\u3042\u308b\u3082\u306e\u3092\u8cb7\u3046\u3067\u826f\u304b\u3063\u305f\u3068\u601d\u3046\u3093\u3067\u3059\u3002\r\n\u3067\u3082\u3001\u4eca\u306f10\u5206\u3082\u3042\u308c\u3070\u5927\u4f53\u306e\u60c5\u5831\u304c\u624b\u306b\u5165\u3063\u3066\u3057\u307e\u3046\u304b\u3089\u3001\u305d\u308c\u3092\u96c6\u3081\u305a\u306b\u8cb7\u3044\u7269\u3092\u3059\u308b\u306e\u306f\u3001\u591a\u304f\u306e\u4eba\u306b\u3068\u3063\u3066\u6642\u7d66\u4ee5\u4e0a\u306e\u640d\u3092\u3059\u308b\u3053\u3068\u306b\u306a\u3063\u3066\u3057\u307e\u3046\u3068\u601d\u3044\u307e\u3059\u3002\r\n\u3082\u3057\u50d5\u304c\u79d2\u901f\u3067\u4e00\u5104\u5186\u7a3c\u3052\u308b\u4eba\u9593\u3067\u3042\u308c\u3070\u3001\u6642\u9593\u306e\u307b\u3046\u304c\u5927\u4e8b\u306a\u306e\u3067\u305d\u3093\u306a\u3053\u3068\u6c17\u306b\u3057\u307e\u305b\u3093\u304c\u3001\u3053\u306e\u30d6\u30ed\u30b0\u3092\u66f8\u3044\u3066\u3044\u308b\u50d5\u306e\u6642\u7d66\u306f\u305b\u3044\u305c\u304430\u5186\u3067\u3057\u3087\u3046\u3002\r\n\r\n\u643a\u5e2f\u306e\u5951\u7d04\u306a\u3093\u304b\u3082\u7d50\u69cb\u5927\u5909\u3067\u3001\u6614\u306b\u6bd4\u3079\u9078\u629e\u80a2\u304c\u591a\u3044\u5206\u3067\u3001\u8003\u3048\u308b\u3053\u3068\u304c\u304b\u306a\u308a\u591a\u304f\u306a\u308a\u307e\u3057\u305f\u3002\r\n\u96fb\u529b\u3001\u30ac\u30b9\u3082\u81ea\u7531\u5316\u3067\u9078\u629e\u80a2\u304c\u5897\u3048\u305f\u305f\u3081\u3001\u8003\u3048\u308b\u5fc5\u8981\u304c\u3067\u3066\u304d\u307e\u3057\u305f\u3002\r\n\r\n\u305d\u3093\u306a\u3053\u3093\u306a\u3067\u73fe\u4ee3\u4eba\u306f\u8003\u3048\u306a\u3044\u3068\u3044\u3051\u306a\u3044\u3053\u3068\u304c\u305f\u304f\u3055\u3093\u3042\u3063\u3066\u3001\u5b9f\u969b\u5e78\u305b\u306a\u306e\u304b\u3069\u3046\u304b\u3088\u304f\u308f\u304b\u3089\u306a\u3044\u306a\uff5e\u3068\u601d\u3044\u307e\u3059\u3002\r\n\r\n\u3067\u3001\u4eca\u65e5\u306f\u8cfc\u5165\u3057\u305f\u6d17\u6fef\u6a5f\u304c\u5348\u524d\u4e2d\u306b\u5c4a\u304f\u4e88\u5b9a\u3060\u3063\u305f\u306e\u3067\u3001\u671d\u304b\u3089\u305a\u3063\u3068\u5bb6\u3067\u5f85\u3063\u3066\u3044\u307e\u3057\u305f\u3002\r\n\u3057\u304b\u305716\u6642\u306b\u306a\u3063\u3066\u3082\u4e00\u5411\u306b\u3053\u306a\u3044\u306e\u3067\u3001\u96fb\u8a71\u3067\u78ba\u8a8d\u3057\u3066\u307f\u305f\u3068\u3053\u308d\u3001\u4f55\u304b\u306e\u624b\u9055\u3044\u3067\u914d\u9054\u65e5\u304c\u4e00\u30f6\u6708\u5148\u306b\u306a\u3063\u3066\u3044\u307e\u3057\u305f\u3002\r\n\r\n\u305d\u3093\u306a\u3053\u3068\u304c\u3042\u3063\u305f\u306e\u3067\u3001\u663c\u304b\u3089\u5916\u51fa\u3057\u3088\u3046\u3068\u601d\u3063\u3066\u3044\u307e\u3057\u305f\u304c\u3001\u4eca\u65e5\u306f\u4e00\u65e5\u5bb6\u3067\u904e\u3054\u3059\u3053\u3068\u306b\u306a\u308a\u307e\u3057\u305f\u3002\r\n\r\n\u30d3\u30c3\u30af\u30ab\u25cb\u30e9\u3055\u3093\u3001\u3057\u3063\u304b\u308a\u3057\u3066\u304f\u3060\u3055\u3044\u3002\r\n\u307b\u3093\u3068\u306b\u3082\u3046\uff01\uff01\r\n"
history_110 = "\u30d3\u30c3\u30af\u30ab\u25cb\u30e9\u3055\u3093\u3001\u3057\u3063\u304b\u308a\u3057\u3066\u304f\u3060\u3055\u3044\u3002\r\n\u307b\u3093\u3068\u306b\u3082\u3046\uff01\uff01\r\n"
